INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(1, 1, 1, 'Liger', '<p>The&nbsp;<b>liger</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>). The liger has parents in the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>. The liger is distinct from the similar hybrid&nbsp;<a href="https://en.wikipedia.org/wiki/Tigon" title="Tigon">tigon</a>&nbsp;and is the largest of all known&nbsp;<a href="https://en.wikipedia.org/wiki/Extant_taxon" title="Extant taxon">extant</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Felidae" title="Felidae">felines</a>.<sup id="cite_ref-Xixiaku_1-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-Xixiaku-1">[1]</a></sup><sup id="cite_ref-ligerfacts2016_2-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-ligerfacts2016-2">[2]</a></sup></p><p>Ligers enjoy swimming, which is a characteristic of tigers, and are very sociable like lions. Today ligers exist only in captivity because the habitats of the parental species do not overlap in the wild. Historically, when the&nbsp;<a href="https://en.wikipedia.org/wiki/Asiatic_lion" title="Asiatic lion">Asiatic lion</a>&nbsp;was prolific, the&nbsp;<a href="https://en.wikipedia.org/wiki/Territory_(animal)" title="Territory (animal)">territories</a>&nbsp;of lions and tigers did overlap and there are legends of ligers existing in the wild. Notably, ligers typically grow larger than either parent species, unlike&nbsp;<a href="https://en.wikipedia.org/wiki/Tigon" title="Tigon">tigons</a>&nbsp;which tend to be about as large as a female tiger.<sup id="cite_ref-Xixiaku_1-1"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-Xixiaku-1">[1]</a></sup><sup id="cite_ref-ligerfacts2016_2-1"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-ligerfacts2016-2">[2]</a></sup><sup id="cite_ref-messybeast2012_3-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-messybeast2012-3">[3]</a></sup></p>', '<p>The&nbsp;<b>liger</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>). The liger has parents in the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>.', '', 1485492714, 2),
(2, 2, 1, 'Ligre', '<p>El&nbsp;<b>ligre</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">león</a>&nbsp;y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigresa</a>. Pese a tener un origen arcano relacionado con la mitología griega, en Rusia se comprobó su existencia. Su aspecto es el de un gigantesco león con rayas de tigre difusas. Al igual que los leones, los ligres macho desarrollan melena. Su&nbsp;<a href="https://es.wikipedia.org/wiki/Nombre_cient%C3%ADfico" title="Nombre científico">nombre científico</a>&nbsp;es&nbsp;<i>Panthera leo &times; tigris</i>. Hay quienes a la hembra del ligre la llaman legresa<sup id="cite_ref-Kiara_1-0"><a href="https://es.wikipedia.org/wiki/Ligre#cite_note-Kiara-1">1</a></sup>&nbsp;o ligresa.<sup id="cite_ref-2"><a href="https://es.wikipedia.org/wiki/Ligre#cite_note-2">2</a></sup></p>', '<p>El&nbsp;<b>ligre</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">león</a>&nbsp;y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigresa</a>. Pese a tener un origen arcano relacionado con la mitología griega, en Rusia se comprobó su existencia. Su aspecto es el de un gigantesco león con rayas de tigre difusas.', '', 1485493779, 2),
(3, 3, 1, 'Ligron', '<p>Le&nbsp;<b>ligre</b>&nbsp;ou&nbsp;<b>ligron</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>&nbsp;né de l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigresse</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;mâle (l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lionne" title="Lionne">lionne</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigre</a>&nbsp;mâle donne un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigron" title="Tigron">tigron</a>&nbsp;ou tiglon). Le ligre, ainsi que tous les hybrides connus entre différentes espèces félines, est le résultat d&#39;un croisement. On rencontre rarement des hybrides félins dans la nature, du fait de l&#39;éloignement géographique dans de nombreux cas, ainsi que des périodes de reproduction différentes et surtout du comportement différent de chaque espèce vis-à-vis de l&#39;autre.</p>', '<p>Le&nbsp;<b>ligre</b>&nbsp;ou&nbsp;<b>ligron</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>&nbsp;né de l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigresse</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;mâle (l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lionne" title="Lionne">lionne</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigre</a>&nbsp;mâle donne un&nbsp;<a hre', '', 1485492846, 2),
(4, 4, 1, 'Tigon', '<p>A&nbsp;<b>tigon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡən/</a>) or&nbsp;<b>tiglon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡlən/</a>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>). Thus, it has parents with the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>. The tigon is not currently as common as the converse hybrid, the&nbsp;<a href="https://en.wikipedia.org/wiki/Liger" title="Liger">liger</a>; however, in the late 19th<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Cleanup" title="Wikipedia:Cleanup">year&nbsp;needed</a></i>]</sup>&nbsp;and early 20th centuries, Gerald Iles wrote that he had been able to obtain three tigons, but he had never seen a liger.<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup></p><p>The tigon&#39;s genome includes genetic components of both parents.<sup id="cite_ref-autogenerated1_1-0"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-autogenerated1-1">[1]</a></sup>&nbsp;Tigons can exhibit visible characteristics from both parents:<sup id="cite_ref-autogenerated1_1-1"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-autogenerated1-1">[1]</a></sup>&nbsp;they can have both spots from the mother (lions carry genes for spots&mdash;lion cubs are spotted and some adults retain faint markings) and stripes from the father. Any&nbsp;<a href="https://en.wikipedia.org/wiki/Mane_(lion)" title="Mane (lion)">mane</a>&nbsp;that a male tigon may have will appear shorter and less noticeable than a lion&#39;s mane and is closer in type to the ruff of a male tiger. It is a common misconception that tigons are smaller than lions or tigers. They do not exceed the size of their parent species because they inherit growth-inhibitory&nbsp;<a href="https://en.wikipedia.org/wiki/Gene" title="Gene">genes</a>&nbsp;from the lioness mother, but they do not exhibit any kind of dwarfism or miniaturization; they often weigh around 180 kilograms (400&nbsp;lb).<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup></p><p>This cross-breeding (between tiger and lioness) can cause difficulties during pregnancy because a tiger is a bigger cat than a lion.<sup id="cite_ref-2"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-2">[2]</a></sup></p><p>Genetic defects of cubs are not rare. It has been estimated that 1 in 500 000 survives, which shows a very low survival rate.<sup id="cite_ref-3"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-3">[3]</a></sup></p>', '<p>A&nbsp;<b>tigon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡən/</a>) or&nbsp;<b>tiglon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡlən/</a>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Pant', '', 1485493081, 2),
(5, 5, 1, 'Tigon', '<p>Un&nbsp;<b>tigron</b>&nbsp;(ou&nbsp;<b>tiglon</b>) est un&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement artificiel d&#39;une lionne et d&#39;un tigre. Le tigron, comme le&nbsp;<a href="https://fr.wikipedia.org/wiki/Ligre" title="Ligre">ligre</a>&nbsp;(croisement entre un lion et une tigresse), n&#39;est pas rencontré dans la nature, car le lion et le tigre ont des comportements et des habitats radicalement différents.</p><p>Seul le tigron femelle est fertile. La femelle tigron ne peut se reproduire qu&#39;avec un tigre.</p><p>&nbsp;</p>', '<p>Un&nbsp;<b>tigron</b>&nbsp;(ou&nbsp;<b>tiglon</b>) est un&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement artificiel d&#39;une lionne et d&#39;un tigre. Le tigron, comme le&nbsp;<a href="https://fr.wikipedia.org/wiki/Ligre" title="Ligre">ligre</a>&nbsp;(croisement entre un lion et une tigresse), n&#39;est pas rencontré dans la nature, car le lion et le tigre ont des comportements et des habitats radicalement différents.</p><p>Seul le tigron femelle est fertile. La femelle tigron ne peut se reproduire qu&#39;avec un tigre.</p>', '', 1485493113, 2),
(6, 6, 1, 'Tigón', '<p>Un&nbsp;<b>tigón</b>&nbsp;es un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigre</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>&nbsp;criados en cautiverio. Los tigones no son tan frecuentes como los híbridos inversos, llamados&nbsp;<a href="https://es.wikipedia.org/wiki/Ligre" title="Ligre">ligres</a>, producto de la unión de un león y una tigresa. Es poco probable que los tigones se den en la naturaleza, debido a que tigres y leones no comparten hábitat.</p><p>Los tigones presentan características de los dos progenitores, con aspecto de leones con rayas de tigres. Crecen menos que las especies de origen, debido a que heredan, de la leona, genes inhibidores de crecimiento, pero no presentan ningún tipo de&nbsp;<a href="https://es.wikipedia.org/wiki/Enanismo" title="Enanismo">enanismo</a>. Generalmente pesan cerca de 180&nbsp;<a href="https://es.wikipedia.org/wiki/Kilogramo" title="Kilogramo">kg</a>.</p><p>Poseen patas y cola largas, aunque con aspecto imponente. Son menos abundantes que los ligres, ya que éstos son intensamente buscados y explotados por circos debido a su gigantismo y, en menor medida, zoológicos deseosos de atraer al público.</p><p>Generalmente, los tigones son estériles. Sin embargo, una tigona de nombre Noelle en la&nbsp;<a href="https://es.wikipedia.org/w/index.php?title=Reserva_Shambala&amp;action=edit&amp;redlink=1" title="Reserva Shambala (aún no redactado)">Reserva Shambala</a>&nbsp;se apareó con un tigre y produjo un &ldquo;ti-tigón&rdquo;, aunque no se conocen casos de machos fértiles.</p>', '<p>Un&nbsp;<b>tigón</b>&nbsp;es un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigre</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>&nbsp;criados en cautiverio. Los tigones no son tan frecuentes como los híbridos inversos, llamados&nbsp;<a href="https://es.wikipedia.org/wiki/Ligre" title="Ligre">ligres</a>, producto de la unión de un león y una tigresa.', '', 1485493789, 2),
(7, 7, 1, 'Zonkey', '<p>A&nbsp;<b>zebroid</b>&nbsp;(also&nbsp;<b>zedonk</b>,&nbsp;<b>zorse</b>,&nbsp;<b>zebra mule</b>,&nbsp;<b>zonkey</b>, and&nbsp;<b>zebmule</b>) is the offspring of any cross between a&nbsp;<a href="https://en.wikipedia.org/wiki/Zebra" title="Zebra">zebra</a>&nbsp;and any other&nbsp;<a href="https://en.wikipedia.org/wiki/Equine" title="Equine">equine</a>: essentially, a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>. In most cases, the sire is a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>. Offspring of a donkey sire and zebra dam, called a&nbsp;<b>zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hinny" title="Hinny">hinny</a></b>, or&nbsp;<b>donkra</b>, do exist but are rare. Zebroids have been bred since the 19th century.&nbsp;<a href="https://en.wikipedia.org/wiki/Charles_Darwin" title="Charles Darwin">Charles Darwin</a>&nbsp;noted several zebra hybrids in his works.</p>', '<p>A&nbsp;<b>zebroid</b>&nbsp;(also&nbsp;<b>zedonk</b>,&nbsp;<b>zorse</b>,&nbsp;<b>zebra mule</b>,&nbsp;<b>zonkey</b>, and&nbsp;<b>zebmule</b>) is the offspring of any cross between a&nbsp;<a href="https://en.wikipedia.org/wiki/Zebra" title="Zebra">zebra</a>&nbsp;and any other&nbsp;<a href="https://en.wikipedia.org/wiki/Equine" title="Equine">equine</a>: essentially, a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>. In most cases, the sire is a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>.', '', 1485493166, 2),
(8, 8, 1, 'Zebroide', '<p>Un&nbsp;<b>zebroide</b>&nbsp;o&nbsp;<b>cebroide</b>&nbsp;es un animal híbrido obtenido del cruce de una&nbsp;<a href="https://es.wikipedia.org/wiki/Cebra" title="Cebra">cebra</a>&nbsp;con cualquier otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>. En esencia, se trata de un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de cebra. El padre de un zebroide es generalmente una cebra macho. No obstante, existen híbridos de este tipo que han nacido del cruce de una cebra hembra con algún otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>&nbsp;macho, aunque no son casos ordinarios.</p><p>Los zebroides han sido criados desde el siglo XIX.&nbsp;<a href="https://es.wikipedia.org/wiki/Charles_Darwin" title="Charles Darwin">Charles Darwin</a>&nbsp;registró algunos de ellos en sus trabajos.</p><p>Existieron dos especies similares a los cebroides, pero siendo especie y no híbridos:</p><ul><li>El&nbsp;<i><a href="https://es.wikipedia.org/wiki/Quagga" title="Quagga">quagga</a></i>&nbsp;africano, cuyo aspecto intenta actualmente recuperarse con híbridos.</li><li>El&nbsp;<i><a href="https://es.wikipedia.org/wiki/Equus_hydruntinus" title="Equus hydruntinus">encebro</a></i>&nbsp;o&nbsp;<i>zebro</i>&nbsp;que habitó la península ibérica hasta el siglo XV.</li></ul>', '<p>Un&nbsp;<b>zebroide</b>&nbsp;o&nbsp;<b>cebroide</b>&nbsp;es un animal híbrido obtenido del cruce de una&nbsp;<a href="https://es.wikipedia.org/wiki/Cebra" title="Cebra">cebra</a>&nbsp;con cualquier otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>. En esencia, se trata de un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de cebra. El padre de un zebroide es generalmente una cebra macho.', '', 1485493806, 2);

